import React, { Component } from 'react'

export default class Register extends Component {
  render() {
    return (
        <div id="container">
        <PageHeader 
        className="tracking-in-expand-fwd-top" 
        style={{fontFamily: "'Alfa Slab One', cursive",color:"green",textShadow:"2px 2px lightgreen"}}>
        Register
        </PageHeader>
        
        
        </div>
    )
  }
}
